import React, {Component} from 'react';
// import logo from './logo.svg';
import './App.css';

class App extends Component { //shortcut rcc
  constructor(props) { //shortcut con
  super(props);
  this.state={
    monsters:[
      {
        name: 'Duoc Do'
      },
      {
        name: 'Dennis'
      },
      {
        name: 'DiDoTa'
      }
    ]
  };
};

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monster=> <h1>{monster.name}</h1>)}
        }
      </div>
    );
  }
}

export default App;
